// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract ComputingPowerMining is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    /********** 变量定义区 *********/
    // 代币地址
    IERC20 public token;
    // 周期总投放量
    uint256 public totalReleaseAmount;
    // 周期总交易量, 单位USDT, TODO:删除
    uint256 public totalSwappedAmount;
    // 周期开始时间
    uint256 public startTime;
    // 周期结束时间
    uint256 public endTime;
    // 已统计算力
    uint256 public countedPower;

    // 账户算力信息
    struct AccountPowerInfo {
        // 账号地址
        address account;
        // 算力值, 单位USDT
        uint256 power;
        // 得到DAO数量
        uint256 receiveAmount;
        // 当前待释放DAO数量
        uint256 unreleasedAmount;
        // 是否已提取
        bool isClaim;
    }
    // 记录映射关系
    mapping(address => AccountPowerInfo) public accountPowerInfoList;

    /********** 初始化合约 *********/
    constructor(
        IERC20 _token, // 代币地址
        uint256 _totalReleaseAmount, // 周期总投放量
        uint256 _totalSwappedAmount, // 周期总交易量, 单位USDT
        uint256 _startTime, // 周期开始时间
        uint256 _endTime // 周期结束时间
    ) {
        require(address(_token) != address(0), "ComputingPowerMining: token is the zero address");
        require(_totalReleaseAmount > 0, "ComputingPowerMining: total release amount is 0");
        require(_totalSwappedAmount > 0, "ComputingPowerMining: total swaps amount is 0");
        require(_endTime > _startTime, "ComputingPowerMining: Start time cannot be later than end time");

        token = _token;
        totalReleaseAmount = _totalReleaseAmount;
        totalSwappedAmount = _totalSwappedAmount;
        startTime = _startTime;
        endTime = _endTime;
    }

    /********** 后台功能 *********/
    // 设置总投放量
    function setTotalReleaseAmount(uint256 amount) public onlyOwner {
        totalReleaseAmount = amount;
    }
    // 设置总交易量
    function setTotalSwappedAmount(uint256 amount) public onlyOwner {
        totalSwappedAmount = amount;
    }
    // 周期开始时间
    function setStartTime(uint256 time) public onlyOwner {
        require(time <= endTime, "ComputingPowerMining: the start time cannot be later than end time");
        startTime = time;
    }
    // 周期结束时间
    function setEndTime(uint256 time) public onlyOwner {
        require(time > startTime, "ComputingPowerMining: The end time must be later than the start time");
        endTime = time;
    }

    // 提交报表
    function updateAccountPowerList(AccountPowerInfo[] memory list) public onlyOwner {
        require(list.length > 0, "ComputingPowerMining: list array is null");
        for (uint i = 0; i < list.length; i++) {
            AccountPowerInfo memory record = list[i];
            if (record.receiveAmount > 0) {
                address receiveAccount = record.account;
                AccountPowerInfo storage info = accountPowerInfoList[receiveAccount];
                if (info.account == address(0)) {
                    accountPowerInfoList[receiveAccount] = AccountPowerInfo({
                        account: receiveAccount,
                        power: record.power,
                        receiveAmount: record.receiveAmount,
                        unreleasedAmount: record.unreleasedAmount,
                        isClaim: false
                    });
                    countedPower = countedPower.add(record.power);
                }
            }
        }
    }

    /********** 数据校验 *********/
    /**
     * @dev Check if an account has this accountPowerInfoList.
     * @param account the address
     * @return bool
     */
    function hasPowerInfo(address account) public view returns (bool) {
        AccountPowerInfo memory info = accountPowerInfoList[account];
        return info.account != address(0);
    }

    /********** 用户功能 *********/
    /**
     * @dev common claim function
     */
    function claim() public {
        require(block.timestamp >= endTime, "ComputingPowerMining: It's not time to claim yet");
        address account = msg.sender;
        AccountPowerInfo storage info = accountPowerInfoList[account];
        require(info.account != address(0), 'ComputingPowerMining: no account info');
        require(info.isClaim == false, 'ComputingPowerMining: the account is already claimed');

        token.safeTransfer(account, info.receiveAmount);
        info.receiveAmount = 0;
        info.isClaim = true;
    }


    /********** 销毁合约 *********/
    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}

